When Aleali May came to Paris for Fashion Week, we visited her in her penthouse to catch up on all things fashion and beauty. From her street style influences to the way she likes to do her makeup and the 5 things she always has with her in her handbag, take a look inside her wardrobe and get ready with her for the Louis Vuitton show. 
